import React, { useEffect } from "react";

function Tick() {
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
  return element;
}

const App = () => {
  useEffect(() => {
    const timer = setTimeout(() => Tick, 3000);
    return () => clearTimeout(timer);
  }, []);
};

export default App;
